import React from "react";
import"../style.css/Filter.css";
function Filter(){
    return(
        <div>
        <div>
            <h1 className="filter"> Life in city </h1>
        </div>
        <div>
        <div className="col-lg-4 col-md-6 col-sm-12 dineshone" >
                                <div className="card row">
                                    <div className="col-4 photo"> <img className="dinesh" src="./Assets/buildingone.jpg" alt="123" /></div>
                                    <div className="col-8 content"> <h3>Breakfast</h3> <p> Start your day with beautifull views </p></div>
                                </div>
         </div>
        </div>
        </div>
    )
}
export default Filter
